import React, { Component } from 'react'

class Empresas extends Component {

    state = {
        name: '',
        address: '',
        body: '',
        website: '',
        posts: []
    };


    displayPost = (posts) => {

        if(!posts.length) return null;
    
        return posts.map((post, index)=> (
          <div key={index} className="post_display">
            <h3>{post.title}</h3>
            <p>{post.address}</p>
            <p>{post.body}</p>
            <p>{post.website}</p>
          </div>
        ));
    
    }

};

export default Empresas;
